import React from "react";

const Product = (product) => {
    return (
        <div class="product">
            <div>
                <img src="./unsplash_uhzMXsQ7hBA.png" alt="" />
            </div>
            <p>{product.title}</p>
            <p class="price">R${product.price}</p>
            <a href="https://www.google.com/">
                <img src="./Shopping cart.png" alt="" />
                <p>Add to Cart</p>
            </a>
        </div>
    );
};

export default Product;
